import React from 'react'
import { BrowserRouter } from 'react-router-dom'

// components
import App from './App.js'

const Navigation = ()=>{
    return(
      <BrowserRouter>
          <Route path="/" component={App} />
      </BrowserRouter>
    )
}
export default Navigation
